for c_actions in c_actions_list:
    actions = pickle.loads(zlib.decompress(bytes.fromhex(c_actions)))
    X, Y = zip(*actions)
    X = [[embed(c) for c in x] for x in X]
    Y = [embed(y) for y in Y]

    # Append the features and labels to the overall lists
    X_all.extend(X)
    Y_all.extend(Y)

